import React, {useState} from 'react';
import ExpandableKeyValue from './ExpandableKeyValue';

const ViewObject = ({ valObject }) => {
    const keys = Object.keys(valObject);
    const [expanded, setExpanded] = useState(false);
    const handleClick = () => {
        console.log('expanded', expanded);
        setExpanded(!expanded);
    };

    const parseObject = ({key, value, expanded}) => {
        if (typeof value === 'string' || typeof value === 'number' || typeof value === 'boolean') {
            return (
                <div>
                    <span>{key}: </span>
                    <span>{value}</span>
                </div>
              )
        } else if (typeof value === 'object') {
            return (
                <ExpandableKeyValue key={key} value={value} />
            )
        } else {
            return null;
        }
    };
    return (
        <div>
            { keys.map(key => {
              return parseObject({key, value: valObject[key], expanded});
            })}
        </div>
    );
}

export default ViewObject;
